import React from 'react';
import Navigation from "../components/Navigation.js";
import Head from 'next/head'


const About = () => {
    return(
        <div>
            <Head>
                <Title>About</Title>
            </Head>
        <Navigation/>
        <h1>About</h1>
        </div>
    )
}
export default About;
